import React from 'react'
import Miniproject1 from "./Miniproject1"
import {add, mul} from "./Calculatotr"

const sub = (a, b)=>{
    return a-b
}

const App = () => {
    return (
        <>

            <Miniproject1/>
            <h1>the sum is {add(10,10)} </h1>
            <h1>the sub is {sub(10,10)} </h1>

        </>
    )
}

export default App
